          gridwidth:[1920,1024,778,480],
          gridheight:[800,768,960,720],
          lazyType:"all",
          scrolleffect: {
            fade:"on",
            grayscale:"on",
            on_slidebg:"on",
            on_layers:"on",
            on_parallax_layers:"on",
          },
          parallax: {
            type:"mouse",
            origo:"enterpoint",
            speed:400,
            speedbg:0,
            speedls:0,
            levels:[5,10,15,20,25,30,35,40,45,46,47,48,49,50,51,55],
          },
          shadow:0,
          spinner:"spinner3",
          stopLoop:"off",
